import React from "react";
import { Tabs } from "antd";
import { useSelector } from "react-redux";
const { TabPane } = Tabs;

export default function DetailLichChieuPhim() {
  const { thongTinChiTietPhim } = useSelector(
    (state) => state.quanLyPhimReducer
  );
  const renderHeThongRapLichChieu = () => {
    thongTinChiTietPhim.heThongRapChieu.map((HTR, indexHTR) => {
      return (
        <TabPane tab={<img src={HTR.logo} />} key={indexHTR}>
          Content of Tab 1
        </TabPane>
      );
    });
  };

  return <Tabs tabPosition={"left"}>{renderHeThongRapLichChieu()}</Tabs>;
}
